import React, { useState, Fragment, useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";

export function Order() {
  const { mediaType, mediaLink } = useSelector((state) => state.mediaModule);

  const initialUserDetails = {
    type: mediaType,
    link: mediaLink,
    fullName: "",
    phoneNumber: 0,
    address: {
      city: "",
      street: "",
      number: "",
    },
  };
  const [userDetails, setUserDetails] = useState(initialUserDetails);

  return (
    <Fragment>
      <h2>Order page</h2>
      <div>
        <h3>פרטי ההזמנה</h3>
        <h4>{userDetails.type} :סוג</h4>
        <h4>{userDetails.link} :לינק</h4>
      </div>
      <h2>some details form </h2>
      <button> --רכוש עכשיו</button>
    </Fragment>
  );
}
